Following World War III, all the nations of the world agreed to 50 years of strict isolation from one another in order to prevent additional conflicts. 50 years later, the United States comes out of exile, only to learn that no one else went into isolation. The world is a new place, and it's up to the U.S. to figure out who their allies will be in this brave new world. The leaders of the US feel betrayed that no one else stuck to the agreement. It turns out, there was actually a third world war about 10 years after the US went into isolation, and the war was long over by now. It was entirely different world with different nations being the most powerful and some nations were not even around anymore. 
IThe entirety of mainland Asia was now either Russia, China, or India, with Japan off doing its own thing and staying independent and neutral. Most of Africa was taken over by Egypt and Saudi Arabia and most of the countries in Europe formed together to make larger, more power nations. Norway, Sweden, and Finland were now just Scandinavia and all of the nations in the United Kingdom officially formed together and became just The United Kingdoms of England.  All of Latin America formed into the Union, with the exception of Mexico and Cuba. Cuba remained independent and neutral and served as a major port hub for other nations so they were enjoying a new era of riches and prosperity. 

The US was looking for an ally because everything was so shaken up, so they turned to their neighbors of the North;
